import { TextField } from '@mui/material';
import React from 'react';

function DadosUsuario() {
  return (
    <form>
      <TextField id='email' label='email' type='email' />
      <TextField id='senha' label='senha' type='password' />
    </form>
  );
}

export default DadosUsuario;
